import React from "react";
import { NavLink } from "react-router-dom";

import "./NavItem.css";
import ProjectsPage from "../../projects/page/ProjectsPage";

const NavItem = props => {
    return (
        <li className="nav-item">
            <Link className={props.className} to={props.to}>
                {props.children}
            </Link>
        </li>
    );
};

export default NavItem;
